import '../App.css';

function Header() {

    return (
        <header>
            <nav>
                <a href='#'>Home</a>
                <a href='/projects'>Projects</a>
                <a href='/aboutme'>About Me</a>
                <a href='http://localhost:8000'>Blog</a>
            </nav>

        </header>
    );
}

export default Header;

